import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import under_nav_fc from './under_nav';


const root = ReactDOM.createRoot(document.getElementById('root'));


root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
root.render(
  <React.StrictMode>
     <under_nav_fc />
  </React.StrictMode>
);
